    false,nt"url": null,nt"notes": "This narrative report for Audubon Wetland
    Management District outlines accomplishments during the 1978 calendar year. The
    report begins with an introduction to the WMD and information about weather conditions,
    habitat conditions, land acquisition activities, and the system status. Construction,
    maintenance, and wildfires are also described. Habitat management is covered; croplands,
    grasslands, wetlands, forests, and easements for waterfowl management are discussed.
    The wildlife section of the report discusses endangered and threatened species,
    migratory birds, mammals, and non-migratory birds. Interpretation and recreation
    activities are outlined; topics include information and interpretation, recreation,
    and law enforcement. Field investigations, cooperative programs, and items of interest
    are attached.",nt"license_title": "License Not Specified",nt"extras":
